import React from 'react';
import {BrowserRouter, Routes, Route, Link} from 'react-router-dom';
import HomePage from "./pages/HomePage";
import Footer from "./components/Footer";
function App() {
  return (

  <BrowserRouter>
    <Routes>
      <Route path="/" element={<HomePage/>}/>
    </Routes>
    <Footer/>
  </BrowserRouter>


    );
}

export default App;
